Sometimes it is useful to draw attention to functions which have high self-time rather than total-time. (For example, to guide optimisation effort it can be desirable to focus on time-intensive core functions, with minimal distraction by the calling layers of light-weight wrapper functions.) I think it would be good if gprof2dot had _a command line argument to colour nodes by self-time instead of total-time._ It may also be worth switching to a smaller default skew value (since self-time < total-time).

Currently gprof2dot computes weights separately for functions and calls, but the same function weights are used for both pruning the graph (in Profile.prune) and for colouring the nodes (in the Dotwriter class). I think it would be undesirable to prune by self-time (because important context like "main" functions may be cut otherwise). The function weights are computed in Profile.prune, which has access to both total-time (TOTAL_TIME_RATIO) and self-time (TIME_RATIO). At present, one easy way to change the node colouring (and preserve the current pruning) is _at the very end of Profile.prune_ (currently at line **648**) to "compute the prune ratios" a second time (but differently):

```
    colour_nodes_by_selftime = True
    if colour_nodes_by_selftime:
        for function in compat_itervalues(self.functions):
            try:
                function.weight = function[TIME_RATIO]
            except UndefinedEvent:
                pass
```
